/* Will covert hex to text - ASCII */
function hex2a(hexx) {
    var hex = hexx.toString();
    var str = '';
    for (var i = 0; (i < hex.length && hex.substr(i, 2) !== '00'); i += 2)
		str += String.fromCharCode(parseInt(hex.substr(i, 2), 16));
		str = str.replace(/\D/g,'');
    return str;
}

/* Will return an ip array ["123","456","789","0"] when given a haxball connection string */
function conn2iparr(conn) {
	var splittedconn = conn.split("E");
	for (let index = 0; index < splittedconn.length; index++) {
		splittedconn[index] = hex2a(splittedconn[index]);
	}
	return splittedconn;
}

function conn2ip(conn) {
	var splittedip = conn2iparr(conn);
	return (splittedip[0] + "." + splittedip[1] + "." + splittedip[2] + "." + splittedip[3]);
}

function conn2vpnip(conn) {
	var splittedip = conn2iparr(conn);
	return (splittedip[0] + "." + splittedip[1] + "." + splittedip[2]);
}

