room.onPlayerTeamChange = function(changedPlayer, byPlayer) {
	if (changedPlayer.id == 0) {
		room.setPlayerTeam(0, Team.SPECTATORS);
		return;
	}
	if (getAFK(changedPlayer) && changedPlayer.team != Team.SPECTATORS) {
		room.setPlayerTeam(changedPlayer.id, Team.SPECTATORS);
		room.sendAnnouncement(changedPlayer.name + " is AFK !", null, 0xff9a4d, "bold", 1);
		return;
	}
	updateTeams();
	if (room.getScores() != null) {
		var scores = room.getScores();
		if (changedPlayer.team != Team.SPECTATORS && scores.time <= (3/4) * scores.timeLimit  && Math.abs(scores.blue - scores.red) < 2) {
			(changedPlayer.team == Team.RED) ? allReds.push(changedPlayer) : allBlues.push(changedPlayer);
		}
	}
	if (changedPlayer.team == Team.SPECTATORS) {
		setActivity(changedPlayer, 0);
	}
	if (inChooseMode && resettingTeams == false && byPlayer.id == 0) {
		if (Math.abs(teamR.length - teamB.length) == teamS.length) {
			deactivateChooseMode();
			resumeGame();
			var b = teamS.length;
			if (teamR.length > teamB.length) {
				for (var i = 0 ; i < b ; i++) {
					setTimeout(() => { room.setPlayerTeam(teamS[0].id, Team.BLUE); }, 5*i);
				}
			}
			else {
				for (var i = 0 ; i < b ; i++) {
					setTimeout(() => { room.setPlayerTeam(teamS[0].id, Team.RED); }, 5*i);
				}
			}
			return;
		}
		else if ((teamR.length == maxTeamSize && teamB.length == maxTeamSize) || (teamR.length == teamB.length && teamS.length < 2)) {
			deactivateChooseMode();
			resumeGame();
		}
		else if (teamR.length <= teamB.length && redCaptainChoice != "") { // choice remembered
			redCaptainChoice == "top" ? room.setPlayerTeam(teamS[0].id, Team.RED) : redCaptainChoice == "random" ? room.setPlayerTeam(teamS[getRandomInt(teamS.length)].id, Team.RED) : room.setPlayerTeam(teamS[teamS.length - 1].id, Team.RED);
			return;
		}
		else if (teamB.length < teamR.length && blueCaptainChoice != "") {
			blueCaptainChoice == "top" ? room.setPlayerTeam(teamS[0].id, Team.BLUE) : blueCaptainChoice == "random" ? room.setPlayerTeam(teamS[getRandomInt(teamS.length)].id, Team.BLUE) : room.setPlayerTeam(teamS[teamS.length - 1].id, Team.BLUE);
			return;
		}
		else {
			choosePlayer();
		}
	}
}

room.onPlayerLeave = function(player) {
	if (room.getPlayerList().length <= openingNumber && !maintenance) {
		room.setPassword(null);
	}

	updateTeams();
	if (teamR.findIndex((red) => red.id == player.id) == 0 && inChooseMode && teamR.length <= teamB.length) {
		choosePlayer();
		capLeft = true;
		setTimeout(() => { capLeft = false; }, 10);
	}
	if (teamB.findIndex((blue) => blue.id == player.id) == 0 && inChooseMode && teamB.length < teamR.length) {
		choosePlayer();
		capLeft = true;
		setTimeout(() => { capLeft = false; }, 10);
	}
	setActivity(player, 0);
	updateRoleOnPlayerOut();

	if (multiple) {
		multiple = false;
	} else {
		playerConnection = getConn(player);
		if (roomId == 1) {
			localStorage.getItem('activeConnectionsRoom1') ? activeConnectionsOne = JSON.parse(localStorage.getItem('activeConnectionsRoom1')) : activeConnectionsOne = [];
			if (activeConnectionsOne.length == 0) {
				// Nothing
			} else {
				for (var i = activeConnectionsOne.length - 1; i >= 0; i--) {
					if (activeConnectionsOne[i] === playerConnection) {
						activeConnectionsOne.splice(i, 1);
					}
				}
			}
			localStorage.setItem('activeConnectionsRoom1', JSON.stringify(activeConnectionsOne));
		} else {
			localStorage.getItem('activeConnectionsRoom2') ? activeConnectionsTwo = JSON.parse(localStorage.getItem('activeConnectionsRoom2')) : activeConnectionsTwo = [];
			if (activeConnectionsTwo.length == 0) {
				// Nothing
			} else {
				for (var i = activeConnectionsTwo.length - 1; i >= 0; i--) {
					if (activeConnectionsTwo[i] === playerConnection) {
						activeConnectionsTwo.splice(i, 1);
					}
				}
			}
			localStorage.setItem('activeConnectionsRoom2', JSON.stringify(activeConnectionsTwo));
		}
	}

	for (var i = afkList.length - 1; i >= 0; i--) {
		if (afkList[i][0] == player.id) {
			afkList.splice(i, 1);
		}
	}

	if (bankick) {
		bankick = false;
	} else if (kickAction) {
		kickAction = false;
	} else {
		console.log("LEAVE: " + new Date().toLocaleString() + " | " + player.name + " has left the room!")
	}
}

room.onPlayerKicked = function(kickedPlayer, reason, ban, byPlayer) {
	if (ban == true) {
		banList.push([kickedPlayer.name, kickedPlayer.id]); /* Keep track of room bans */

		/* Manage UId Ban via Local Storage */
		localStorage.getItem(getAuth(kickedPlayer)) ? stats = JSON.parse(localStorage.getItem(getAuth(kickedPlayer))) : stats = [0, 0, 0, 0, "0.00", 0, 0, 0, 0, "0.00", "player", kickedPlayer.name, true];
		if (stats[Ss.BAN] == false) {
				stats[Ss.BAN] = true;
		}
		localStorage.setItem(getAuth(kickedPlayer), JSON.stringify(stats));

		/* Manage Conn Ban via Local Storage */
		localStorage.getItem(getConn(kickedPlayer)) ? banConn = JSON.parse(localStorage.getItem(getConn(kickedPlayer))) : banConn = [false, [kickedPlayer.name]];
		if (banConn[Bc.BAN] == false) {
			banConn[Bc.BAN] = true;
		} else {
			if (banConn[Bc.NAME].length > 1) {
				var found = 0;
				banConn[Bc.NAME].forEach(e => {
					if (e == kickedPlayer.name) {
						found++;
					}
				});
				if (found == 0) {
					banConn[Bc.NAME].push(kickedPlayer.name);
				}
			} else {
				if (banConn[Bc.NAME][0] == kickedPlayer.name) {
					//cool
				} else {
					banConn[Bc.NAME].push(kickedPlayer.name);
				}
			}
		}
		localStorage.setItem(getConn(kickedPlayer), JSON.stringify(banConn));
		if (byPlayer.id == 0) {
			console.log("-----------------------------------------------------------------------------------------------------------------------------------------------------------");
			console.log("BAN: " + new Date().toLocaleString() + " | Auth: " + getAuth(kickedPlayer) + " - Connection: " + getConn(kickedPlayer) + " - IP: " + conn2ip(getConn(kickedPlayer)) + " - Name: " + kickedPlayer.name + " was banned! Action Taken by James - Reason: " + reason);
			console.log("-----------------------------------------------------------------------------------------------------------------------------------------------------------");
		} else {
			console.log("-----------------------------------------------------------------------------------------------------------------------------------------------------------");
			console.log("BAN: " + new Date().toLocaleString() + " | Auth: " + getAuth(kickedPlayer) + " - Connection: " + getConn(kickedPlayer) + " - IP: " + conn2ip(getConn(kickedPlayer)) + " - Name: " + kickedPlayer.name + " was banned! Action Taken by Admin: " + byPlayer.name + " - IP: " + conn2ip(getConn(byPlayer)) + " - Reason: " + reason);
			console.log("-----------------------------------------------------------------------------------------------------------------------------------------------------------");
		}

	} else {
		if (byPlayer.id == 0) {
			console.log("KICK: " + new Date().toLocaleString() + " | Auth: " + getAuth(kickedPlayer) + " - Connection: " + getConn(kickedPlayer) + " - IP: " + conn2ip(getConn(kickedPlayer)) + " - Name: " + kickedPlayer.name + " was kicked! Action Taken by James - Reason: " + reason);
		} else {
			console.log("KICK: " + new Date().toLocaleString() + " | Auth: " + getAuth(kickedPlayer) + " - Connection: " + getConn(kickedPlayer) + " - IP: " + conn2ip(getConn(kickedPlayer)) + " - Name: " + kickedPlayer.name + " was kicked! Action Taken by Admin: " + byPlayer.name + " - IP: " + conn2ip(getConn(byPlayer)) + " - Reason: " + reason);
		}
	}
}

